import React, { useEffect } from 'react'
import axios from 'axios'

export default function App() {
  useEffect(() => {
    const res = axios
      .get(
        'https://www.flipkart.com/redmi-note-4-black-64-gb/p/itmeqe48766xqzb7?pid=MOBEQ98TABTWXGTD',
      )
      .then(res)
  }, [])

  return <div></div>
}
